USE PressGangCCMS;

CREATE TABLE IF NOT EXISTS `RS_ENDPOINT` (`ENDPOINT_ID` BIGINT AUTO_INCREMENT NOT NULL, `ENDPOINT_METHOD` VARCHAR(255), `ENDPOINT_URL` VARCHAR(255) NOT NULL, `URL_REGEX` BOOLEAN NOT NULL, PRIMARY KEY (`ENDPOINT_ID`), UNIQUE (`ENDPOINT_URL`, `ENDPOINT_METHOD`))
  ENGINE = InnoDB
  DEFAULT CHARSET = utf8;

CREATE TABLE IF NOT EXISTS `RS_SCOPE` (`SCOPE_ID` BIGINT AUTO_INCREMENT NOT NULL, `SCOPE_NAME` VARCHAR(255) NOT NULL, PRIMARY KEY (`SCOPE_ID`), UNIQUE (`SCOPE_NAME`))
  ENGINE = InnoDB
  DEFAULT CHARSET = utf8;

CREATE TABLE IF NOT EXISTS `RS_SCOPE_RS_ENDPOINT` (`SCOPE_ID` BIGINT NOT NULL, `ENDPOINT_ID` BIGINT NOT NULL, PRIMARY KEY (`SCOPE_ID`, `ENDPOINT_ID`))
  ENGINE = InnoDB
  DEFAULT CHARSET = utf8;









































ALTER TABLE `RS_SCOPE_RS_ENDPOINT` ADD CONSTRAINT `FK_RS_SCOPE_RS_ENDPOINT_SCOPE_ID` FOREIGN KEY (`SCOPE_ID`) REFERENCES `RS_SCOPE` (`SCOPE_ID`), ADD CONSTRAINT `FK_RS_SCOPE_RS_ENDPOINT_ENDPOINT_ID` FOREIGN KEY (`ENDPOINT_ID`) REFERENCES `RS_ENDPOINT` (`ENDPOINT_ID`);
